import React from 'react';
import './tarjeta.css';

function ProyectoDetalle() {
  return (
    <div className="tarjeta">
      <h2><i className="fas fa-folder"></i> Título del proyecto: AGUA POTABLE Y SANEAMIENTO BÁSICO</h2>
      <ul>
        <li>Descripción del proyecto: No registra</li>
        <li>Fuentes de datos: e2628c4-7295...</li>
        <li>Fecha de creación: viernes, 22 de septiembre de 2023, 5:03 a. m.</li>
        <li>Fecha de última modificación: No registra</li>
        <li>Autor: adminAguaMinvivienda</li>
        <li>Grupo del proyecto: AguaMinvivienda</li>
      </ul>
    </div>
  );
}

export default ProyectoDetalle;
